import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';

import './About.css';
// import AboutPic from './about.png';
import AboutPic from './about_lighter.png';

export default props => {
    return(
        <div className="about-pg">
            <Container>
                <Row>
                    <Col xs={12} sm={12} md={4} lg={4} className="col-styles">
                        <img src={AboutPic} className="about-polaroid" />
                        <br/>
                        <p className="about-links-container">
                            <a href="https://www.github.com/lichellegaerlan" className="about-links" target="_blank">Github</a> / <a href="https://www.linkedin.com/lichellemaegaerlan" className="about-links" target="_blank">LinkedIn</a>
                        </p>
                    </Col>

                    <Col xs={12} sm={12} md={4} lg={4} className="col-styles">
                        <h1 className="about-headers">Bio</h1>
                        <p className="about-text">
                            My passion for technology and design began when I was a kid who was just
                            creating HTML/CSS layouts on MySpace and Tumblr. <br/>

                            I ended up pursuing and earning a degree in Computer Science from the University of Nevada, Las Vegas. 
                        </p>
                    </Col>

                    <Col xs={12} sm={12} md={4} lg={4} className="col-styles">
                        <h2 className="about-headers">Goals</h2>
                    </Col>
                </Row>

            </Container>
        </div>
    );
}
